import React, { useState } from 'react';

interface FormData {
  intakeDate: string;
  navigatorName: string;
  // ORIA Section
  oria: {
    selected: boolean;
    affordableHousing: boolean;
    teenKidCloset: boolean;
    medical: boolean;
    other: boolean;
  };
  // EMM Section
  emm: {
    selected: boolean;
    internalReferral: {
      selected: boolean;
      economicEmpowerment: boolean;
      womensEmpowerment: boolean;
      youthEmpowerment: boolean;
    };
  };
  // Participant Information
  participantInfo: {
    name: string;
    lastName: string;
    dateOfBirth: string;
    gender: string;
    countryOfOrigin: string;
    phoneNumber: string;
    emailAddress: string;
    address: string;
  };
  // Immigration Status
  immigrationStatus: {
    refugee: boolean;
    asylum: boolean;
    asylumDateGranted: string;
    cubanHaitianEntrants: boolean;
    amerasians: boolean;
    humanTraffickingVictims: boolean;
    iraqiAfghanSpecialImmigrants: boolean;
    afghanHumanitarianParolees: boolean;
    afghansWithSpecialParole: boolean;
    ukrainianHumanitarianParolees: boolean;
  };
  // Additional Information
  alienNumber: string;
  eligibilityDate: string;
  // Program Eligibility
  programEligibility: {
    receivingServices: boolean;
    over16: boolean;
    livesInWashington: boolean;
    arrivedAfterJuly2021: boolean;
    approvedStatus: boolean;
    consentForm: boolean;
    releaseInformation: boolean;
    immigrationStatusCopy: boolean;
  };
  // Services Needed
  servicesNeeded: {
    housing: boolean;
    employmentFinancials: boolean;
    medical: boolean;
    assistanceServices: boolean;
    other: boolean;
  };
}

const IntakeForm: React.FC = () => {
  const [formData, setFormData] = useState<FormData>({
    intakeDate: '',
    navigatorName: '',
    oria: {
      selected: false,
      affordableHousing: false,
      teenKidCloset: false,
      medical: false,
      other: false
    },
    emm: {
      selected: false,
      internalReferral: {
        selected: false,
        economicEmpowerment: false,
        womensEmpowerment: false,
        youthEmpowerment: false
      }
    },
    participantInfo: {
      name: '',
      lastName: '',
      dateOfBirth: '',
      gender: '',
      countryOfOrigin: '',
      phoneNumber: '',
      emailAddress: '',
      address: ''
    },
    immigrationStatus: {
      refugee: false,
      asylum: false,
      asylumDateGranted: '',
      cubanHaitianEntrants: false,
      amerasians: false,
      humanTraffickingVictims: false,
      iraqiAfghanSpecialImmigrants: false,
      afghanHumanitarianParolees: false,
      afghansWithSpecialParole: false,
      ukrainianHumanitarianParolees: false
    },
    alienNumber: '',
    eligibilityDate: '',
    programEligibility: {
      receivingServices: false,
      over16: false,
      livesInWashington: false,
      arrivedAfterJuly2021: false,
      approvedStatus: false,
      consentForm: false,
      releaseInformation: false,
      immigrationStatusCopy: false
    },
    servicesNeeded: {
      housing: false,
      employmentFinancials: false,
      medical: false,
      assistanceServices: false,
      other: false
    }
  });

  const handleSubmit = (e: React.FormEvent<HTMLFormElement>): void => {
    e.preventDefault();
    console.log('Form submitted:', formData);
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-indigo-50 to-blue-50">
      <div className="max-w-4xl mx-auto py-12 px-4">
        <div className="bg-white rounded-lg shadow-xl p-8">
          <div className="text-center mb-8">
            <h1 className="text-3xl font-bold text-gray-900">THRIVE</h1>
            <p className="text-lg text-gray-600">INTERNATIONAL</p>
            <h2 className="text-2xl font-bold text-gray-900 mt-4">INTAKE/REGISTRATION FORM</h2>
          </div>

          <form onSubmit={handleSubmit} className="space-y-8">
            {/* Basic Information */}
            <div className="grid grid-cols-2 gap-6">
              <div>
                <label className="block text-sm font-medium text-gray-700">Intake Date</label>
                <input
                  type="date"
                  value={formData.intakeDate}
                  onChange={(e) => setFormData({...formData, intakeDate: e.target.value})}
                  className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500"
                />
              </div>
              <div>
                <label className="block text-sm font-medium text-gray-700">Navigator Name</label>
                <input
                  type="text"
                  value={formData.navigatorName}
                  onChange={(e) => setFormData({...formData, navigatorName: e.target.value})}
                  className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:border-indigo-500 focus:ring-indigo-500"
                />
              </div>
            </div>

            {/* Program Selection */}
            <div className="space-y-4">
              <div>
                <label className="block text-sm font-medium text-gray-700 mb-2">Program Selection</label>
                <div className="space-y-2">
                  <div>
                    <label className="inline-flex items-center">
                      <input
                        type="checkbox"
                        checked={formData.oria.selected}
                        onChange={(e) => setFormData({
                          ...formData,
                          oria: {...formData.oria, selected: e.target.checked}
                        })}
                        className="rounded border-gray-300 text-indigo-600 shadow-sm focus:border-indigo-500 focus:ring-indigo-500"
                      />
                      <span className="ml-2">ORIA</span>
                    </label>
                    {formData.oria.selected && (
                      <div className="ml-6 space-y-2 mt-2">
                        <label className="inline-flex items-center">
                          <input
                            type="checkbox"
                            checked={formData.oria.affordableHousing}
                            onChange={(e) => setFormData({
                              ...formData,
                              oria: {...formData.oria, affordableHousing: e.target.checked}
                            })}
                            className="rounded border-gray-300 text-indigo-600 shadow-sm focus:border-indigo-500 focus:ring-indigo-500"
                          />
                          <span className="ml-2">Affordable Housing</span>
                        </label>
                        {/* Add other ORIA checkboxes similarly */}
                      </div>
                    )}
                  </div>
                  {/* Add EMM section similarly */}
                </div>
              </div>
            </div>

            {/* Participant Information */}
            <div className="space-y-4">
              <h3 className="text-lg font-medium text-gray-900">Participant Information</h3>
              <div className="grid grid-cols-2 gap-6">
                {/* Add all participant information fields */}
              </div>
            </div>

            {/* Immigration Status */}
            <div className="space-y-4">
              <h3 className="text-lg font-medium text-gray-900">Current Immigration Status</h3>
              <div className="space-y-2">
                {/* Add immigration status checkboxes */}
              </div>
            </div>

            {/* Program Eligibility */}
            <div className="space-y-4">
              <h3 className="text-lg font-medium text-gray-900">Program Eligibility Determination</h3>
              <div className="space-y-2">
                {/* Add eligibility checkboxes */}
              </div>
            </div>

            {/* Services Needed */}
            <div className="space-y-4">
              <h3 className="text-lg font-medium text-gray-900">Services Needed</h3>
              <div className="space-y-2">
                {/* Add services checkboxes */}
              </div>
            </div>

            <button
              type="submit"
              className="w-full flex justify-center py-3 px-4 border border-transparent rounded-lg shadow-sm text-sm font-medium text-white bg-indigo-600 hover:bg-indigo-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-indigo-500 transition-colors"
            >
              Submit
            </button>
          </form>
        </div>
      </div>
    </div>
  );
};

export default IntakeForm;
